opcode_t *
Parrot_trap(opcode_t *cur_opcode, PARROT_INTERP) {
    UNUSED(interp);
    #if defined(__GNUC__) && defined(i386) && !defined(sun)
        __asm__("int3");

#endif
;
    #if defined(__GNUC__) && defined(PPC)
        __asm__("trap");

#endif
;
    return cur_opcode + 1;
}

